import React from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import { Carousel } from 'react-responsive-carousel';
import { Link } from "react-router-dom";
import { useParams } from 'react-router-dom';



export default function IndSpringDetail (props) {
    
    let currentHotSpringSite;
    const id = useParams();
    console.log(typeof id.id);
    console.log(props.allHotSpringData);
    props.allHotSpringData.forEach(e => {
        if(e._id === id.id){
            currentHotSpringSite = e
        }
    });
    console.log(currentHotSpringSite);

    return(
        
    <div>
        <Navbar/>
        <div className="container">
		<div className="page-header">
        <div className="headerdivider">
			</div>
            
			<h1>{currentHotSpringSite.name}</h1>
			<div className="headerdivider">
			</div>
		</div>
		<div className="row">
			<div className="col-md-6">
				<p>
					<b>State</b> : {currentHotSpringSite.state} | <b>Area</b> : {currentHotSpringSite.area} | <b>Day Use Fee</b> : {currentHotSpringSite.dayUseFee}<br/>
					<b>Resort</b> : {currentHotSpringSite.resort} | <b>Open Season</b> : {currentHotSpringSite.open}
				</p>
				<p>
                {currentHotSpringSite.description}
				</p>
				<ul className="icons-ul">
					<li>Overnight Facilities</li>
					<li>Road Access</li>
					<li>Google Link</li>
					<li>Website (If Available)</li>
					<li>latitude/longitude</li>
					<li>Butcher retro keffiyeh</li>
				</ul>
				<br/>
				<p className="clearfix">
					<a href="contact.html" className="btn btn-primary"><i className="icon icon-envelope"></i> Ask for a similar project</a>
				</p>
			</div>
			{/* <!-- end description area --> */}
			{/* <!-- begin slider area --> */}
			<div className="col-md-6 top10">
            <Carousel autoPlay={true} infiniteLoop={true} showArrows={true} swipeable={true} stopOnHover={true} emulateTouch={true}>
                {/* <div>
                        <Link to={`/sitedetail/${props.hotSpringDataObject[0].id}`}><img  src={props.hotSpringDataObject[0].image} /></Link>
                        <Link to={`/sitedetail/${props.hotSpringDataObject[0].id}`}><p classNameName="legend">{props.hotSpringDataObject[0].name}</p></Link>
                </div>
                <div>
                            <Link to={`/sitedetail/${props.hotSpringDataObject[1].id}`}><img  src={props.hotSpringDataObject[1].image} /></Link>
                            <Link to={`/sitedetail/${props.hotSpringDataObject[1].id}`}><p classNameName="legend">{props.hotSpringDataObject[1].name}</p></Link>
                </div> */}
            </Carousel>
				<div className="clearfix"></div>
			</div>
		</div>
	</div>
        <Footer/>
    </div>
    )
}
